// import React from 'react';
import {React, useState} from 'react';
import {useNavigate} from 'react-router-dom';
import axios from 'axios';
import AccessAlarmIcon from '@mui/icons-material/AccessAlarm';

import './Home.css';
/**
 * Simple component with no state.
 *
 * See the basic-react example for an example of adding and reacting to
 * changes in state and lecture 10 for details on Material-UI
 *
 * @return {object} JSX
 */
export default function Home() {
  const [recipesList, setRecipesList] = useState([]);
  const navigate = useNavigate();

  const navigateToCuisine = () => {
    navigate('/cuisine');
  };

  const randRecipes = async () => {
    const res = await axios.get('https://api.spoonacular.com/recipes/random', {
      params: {apiKey: 'c33d1c92ed8343d7b6522ddb630cdfd4', number: 15},
    });
    setRecipesList(res.data.recipes);
    // console.log(recipesList);
    // const RL = recipesList.map((recipe) => recipe.title);
    // console.log(RL);
  };
  return (
    <div>
      <h1 className='title'>AKALAT</h1>
      <nav class='navbar navbar-expand-lg navbar-light bg-light'>
        <a class='navbar-brand' href='#'>
          Navbar
        </a>
        <button
          class='navbar-toggler'
          type='button'
          data-toggle='collapse'
          data-target='#navbarNavDropdown'
          aria-controls='navbarNavDropdown'
          aria-expanded='false'
          aria-label='Toggle navigation'
        >
          <span class='navbar-toggler-icon'></span>
        </button>
        <div class='collapse navbar-collapse' id='navbarNavDropdown'>
          <ul class='navbar-nav'>
            <li class='nav-item active'>
              <a class='nav-link' href='#'>
                Home <span class='sr-only'>(current)</span>
              </a>
            </li>
            <li class='nav-item'>
              <a class='nav-link' href='#'>
                Features
              </a>
            </li>
            <li class='nav-item'>
              <a class='nav-link' href='#'>
                Pricing
              </a>
            </li>
            <li class='nav-item dropdown'>
              <a
                class='nav-link dropdown-toggle'
                href='#'
                id='navbarDropdownMenuLink'
                data-toggle='dropdown'
                aria-haspopup='true'
                aria-expanded='false'
              >
                Dropdown link
              </a>
              <div
                class='dropdown-menu'
                aria-labelledby='navbarDropdownMenuLink'
              >
                <a class='dropdown-item' href='#'>
                  Action
                </a>
                <a class='dropdown-item' href='#'>
                  Another action
                </a>
                <a class='dropdown-item' href='#'>
                  Something else here
                </a>
              </div>
            </li>
          </ul>
        </div>
      </nav>
      <button onClick={randRecipes} className='button1'>
        Dish
      </button>
      <button onClick={navigateToCuisine} className='button2'>
        Cuisine
      </button>
      <button className='button3'>Ingredients</button>
      <h2 className='explore'>Explore</h2>
      {recipesList.map((recipe) => (
        <div className='randRecipeList' key={recipe.title}>
          <ul>
            {/* <li>
              <img src={recipe.image} alt={'k'} />
            </li>
            <li>{recipe.title}</li> */}
            <li>
              {recipe.title}
              <img src={recipe.image} alt={'k'} />
              <AccessAlarmIcon></AccessAlarmIcon>
              {recipe.readyInMinutes}
            </li>
          </ul>
        </div>
      ))}
    </div>
  );
}
